    return (
            <div className='card-component shadow-lg p-4 rounded mx-3 my-5'>
                <span className='soldout-text px-2 m-3'>SoldOut</span>
                <img src={Card1} className='card-image shadow-lg'></img>
                <span><FaStar className='star'/>5.0 (6) USA</span>
                <br></br>
                <span>Life Lessons from Zate</span>
                <br></br>
                <span><b>From 123$</b> / person</span>
            </div>
    )
}

export default cards;
